import styled from "styled-components";

const AssesStyle = {
    ContainerBidder: styled.div`
    
    `,
    ContainerBtns: styled.div`
    padding-left: 120px;
    `,
    Btn: styled.button`
    margin
    padding: 10px;
    border-radius: 45px;
    background-color: grey;
    `
}

export default AssesStyle
